import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter as Router } from "react-router-dom";
import App from "./App";
import "./styles/main.scss";

ReactDOM.render(
  <React.StrictMode>
    <Provider></Provider>
    <Router>
      <App></App>
    </Router>
  </React.StrictMode>,
  document.getElementById("root")
);
